import * as S from '../styles/MainPage.style'

function Header({ route }) {
  return(
    <S.Header>
        <div>Header</div>
        <S.Link as="a" href="/mainpage" route={route}>
          <span>Diary</span>
        </S.Link>
        <S.Link as="a" href="/routine" >
          <span>Routine</span>
        </S.Link>
        <S.Link as="a" href="/mypage">
          <span>MyPage</span>
        </S.Link>
        <S.Link>Image</S.Link>
      </S.Header>
  );
};

export default Header;
